import React from 'react'
const MovieOne = ({data}) => {

    const title=data.list[0].page.title
    
    console.log(data.list[0].page.title)

    return (
        <div>
        <h4 className="m-0 py-3">{title}</h4>
        <hr className="m-0 mb-3" />
            <pre>
                {JSON.stringify(data)}
            </pre>

        </div>
    )
}

export default MovieOne
